import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { motion, AnimatePresence } from 'framer-motion';
import { useMediaQuery } from 'react-responsive';


const TreeNavigation = () => {
  const isMobile = useMediaQuery({ query: '(max-width: 768px)' });
  const [leaves, setLeaves] = useState([]);

  const navItems = [
    { path: '/about', label: 'About Us', x: 120, y: 180 },
    { path: '/contact', label: 'Contact', x: -120, y: 220 },
    { path: '/resources', label: 'Resources', x: 180, y: 260 },
    { path: '/little-library', label: 'Little Free Library', x: -180, y: 300 }
  ];

  // Create falling leaves
  useEffect(() => {
    const createLeaf = () => ({
      id: Math.random(),
      x: Math.random() * window.innerWidth,
      delay: Math.random() * 5,
      duration: 10 + Math.random() * 5
    });

    setLeaves(Array.from({ length: 10 }, createLeaf));

    const interval = setInterval(() => {
      setLeaves(prev => [...prev.slice(-9), createLeaf()]);
    }, 3000);

    return () => clearInterval(interval);
  }, []);

  const branchVariants = {
    hover: {
      y: [0, -5, 0],
      transition: {
        duration: 2,
        repeat: Infinity,
        ease: "easeInOut"
      }
    }
  };

  const mobileNavItems = navItems.map(item => ({
    ...item,
    x: 0,
    y: navItems.indexOf(item) * 100 + 100
  }));

  const currentItems = isMobile ? mobileNavItems : navItems;

  return (
    <div className="relative min-h-screen w-full bg-gradient-to-b from-green-50 to-green-100 overflow-hidden">
      {/* Background and overlay */}
      <div className="absolute inset-0 bg-cover bg-center opacity-90" />

      {/* Falling Leaves */}
      <AnimatePresence>
        {leaves.map((leaf) => (
          <motion.div
            key={leaf.id}
            initial={{ 
              x: leaf.x,
              y: -20,
              rotate: 0,
              opacity: 0.8
            }}
            animate={{ 
              y: window.innerHeight + 20,
              rotate: 360,
              opacity: 0
            }}
            exit={{ opacity: 0 }}
            transition={{ 
              duration: leaf.duration,
              delay: leaf.delay,
              ease: "linear"
            }}
            className="absolute w-4 h-4 text-green-600"
          >
            🍂
          </motion.div>
        ))}
      </AnimatePresence>

      {/* Content */}
      <div className="relative z-10 pt-16 px-4">
        <motion.h1 
          className="text-4xl md:text-6xl font-bold text-center text-amber-900 mb-8"
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          Brooks'Books
        </motion.h1>

        <motion.p 
          className="text-xl text-center text-amber-800 max-w-2xl mx-auto mb-12"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.3 }}
        >
          Where digital reading meets treehouse libraries
        </motion.p>

        {/* Tree Navigation */}
        <svg 
          viewBox={isMobile ? "0 0 400 800" : "0 0 800 600"}
          className="w-full max-w-4xl mx-auto"
        >
          {/* Animated Tree Trunk */}
          <motion.path
            d={isMobile ? 
              "M200 50 L200 750" : 
              "M380 500 Q400 400 400 300 Q400 200 380 100"
            }
            className="stroke-amber-900"
            strokeWidth="40"
            fill="none"
            initial={{ pathLength: 0 }}
            animate={{ pathLength: 1 }}
            transition={{ duration: 1.5 }}
          />

          {/* Branches and Navigation */}
          {currentItems.map((item, index) => (
            <g key={index}>
              <motion.path
                d={isMobile ?
                  `M200 ${item.y - 50} h${item.x + 100}` :
                  `M400 ${300 + item.y/2} Q${400 + item.x/2} ${300 + item.y/3} ${400 + item.x} ${300 + item.y}`
                }
                className="stroke-amber-800"
                strokeWidth="20"
                fill="none"
                variants={branchVariants}
                whileHover="hover"
                initial={{ pathLength: 0 }}
                animate={{ pathLength: 1 }}
                transition={{ duration: 1, delay: index * 0.2 }}
              />

              <motion.g
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={{ delay: 0.5 + index * 0.2 }}
                whileHover={{ scale: 1.1 }}
              >
                <Link to={item.path}>
                  <circle
                    cx={isMobile ? 300 : 400 + item.x}
                    cy={isMobile ? item.y : 300 + item.y}
                    r="40"
                    className="fill-green-100 stroke-amber-900 stroke-2 cursor-pointer transition-all duration-300 hover:fill-green-200"
                  />
                  <text
                    x={isMobile ? 300 : 400 + item.x}
                    y={isMobile ? item.y : 300 + item.y}
                    textAnchor="middle"
                    dominantBaseline="middle"
                    className="text-sm font-semibold fill-amber-900 pointer-events-none"
                  >
                    {item.label}
                  </text>
                </Link>
              </motion.g>
            </g>
          ))}

          {/* Animated Foliage */}
          <motion.g
            animate={{
              y: [0, -5, 0],
              x: [0, 2, 0]
            }}
            transition={{
              duration: 3,
              repeat: Infinity,
              ease: "easeInOut"
            }}
          >
            <circle cx="400" cy="150" r="100" className="fill-green-800 opacity-80" />
            <circle cx="300" cy="200" r="80" className="fill-green-700 opacity-80" />
            <circle cx="500" cy="200" r="90" className="fill-green-800 opacity-80" />
            <circle cx="380" cy="250" r="70" className="fill-green-700 opacity-80" />
            <circle cx="450" cy="180" r="85" className="fill-green-800 opacity-80" />
          </motion.g>
        </svg>
      </div>
    </div>
  );
};

export default TreeNavigation;
